import styled from 'styled-components';

const Wrapper = styled.div`
  background-color: aqua;
  width: 700px;
  height: 400px;
  font-size: 30px;
`

function App() {
  return (
    <Wrapper>
      <h1>Hello React!</h1>
    </Wrapper>
  );
}

export default App;
